using LeetCode;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace UnitTestProject
{
    [TestClass]
    public class Single_RowKeyboardTests
    {
        [TestMethod]
        public void CalculateTimeTests()
        {
            Single_RowKeyboard obj = new Single_RowKeyboard();

            string keyboard = "abcdefghijklmnopqrstuvwxyz";
            string word = "cba";
            var x = obj.CalculateTime(keyboard, word);//4

            keyboard = "abcd";
            word = "cbaa";
            x = obj.CalculateTime(keyboard, word);//4

            keyboard = "pqrs";
            word = "rps";
            x = obj.CalculateTime(keyboard, word);//7

            keyboard = "pqrstuvwxyzabcdefghijklmno";
            word = "leetcode";
            x = obj.CalculateTime(keyboard, word);//73

            keyboard = "pyevcountbgjklxfqwimrdhazs";
            word = "";
            x = obj.CalculateTime(keyboard, word);//66042
        }
    }

}
